    [],nt"num_tags": 0,nt"name": "cooperative-trap-survey-for-nearshore-groundfish",nt"isopen":
    false,nt"url": null,nt"notes": "This pilot study is designed to evaluate
    a fishery-independent, cooperative sampling methodology for nearshore groundfish
    species, with an emphasis on species in the genus Sebastes (rockfishes). Trawl surveys
    off the U.S. West Coast currently do not sample waters shallower than 55 meters,
    and avoid high-relief habitat. In 2012, the pilot study focused on sampling procedures
    for untrawlable habitat in depths between 10 and 60 meters. Catch of finfish by
    cruise, set, and trap is processed at the lab. Fish are identified to species, measured
    (fork length), and sexed. Otoliths of all rockfish species and a subset of non-rockfish
    species were retained for age and growth studies. Processing of samples is ongoing,
    tissue samples will be collected to assist with ongoing genetic studies at our facility.",nt"owner_org":
